From within the forests of #Uttarakhand come the sounds of secrets that only nature holds. The story of Rajula & Malushahi was written first only in the 1930's but has echoed in forests for centuries. If you listen carefully you’ll also hear this love story, whispered through the rustling of the leaves and repeated through the gurgling of the streams flowing through the hills. 
